import React, { Component } from "react";

import "tabler-react/dist/Tabler.css";

import { Nav, Site, Page, Button, Grid, Form } from "tabler-react";

import LogTable from "./tracker_dashboard/LogTable.react";

class App extends Component {
  render() {
    return (
      <Site>
        <Nav>
          <Nav.Item hasSubNav value="DashBoard" icon="globe" />
        </Nav>
        <Page.Content title="DashBoard">
          <Grid>
            <Form.Group label="Date Picker">
              <Form.DatePicker
                defaultDate={new Date("2018-11-30T07:05:55.733Z")}
                format="yyyy/mm/dd/"
                maxYear={2018}
                minYear={2017}
                monthLabels={[
                  "January",
                  "February",
                  "March",
                  "April",
                  "May",
                  "June",
                  "July",
                  "August",
                  "September",
                  "October",
                  "November",
                  "December"
                ]}
              />
            </Form.Group>
            <Button>Go</Button>
          </Grid>
          <Grid>
            <LogTable />
          </Grid>
        </Page.Content>
      </Site>
    );
  }
}

export default App;
